	 (6681,1,0,'Did you meet Milton?<Fahrad laughs.>',12340),
	 (6701,1,0,'We have been entrenched in a battle with the Syndicate for years. What they lack in skill they make up for in numbers. It''s impossible to kill them off fast enough to have any noticeable impact on their population!$B$BWe''ve found that the best way to deal with their size is to pilfer their emblems. Once an emblem is stolen the shamed member is ''dealt'' with internally.$B$BPick their pockets clean and turn the emblems in to me or one of the other guards.$B$BStart at Durnholde, south of here.',12340);
